import { useEffect, useState } from 'react';

function Data() { 

    const [csvData, setCsvData] = useState([]);

    useEffect(() => { 
        fetch("/data.csv")
            .then((response) => response.text())
            .then((text) => { 
                const rows = text.split("\n").map((row) => row.split(','));
                setCsvData(rows);
            })
    })





    return  (
        <>
